(16, 'UNIT 1: COMPUTER FUNDAMENTALS', '<div>INTRODUCTION</div><div>It is a fact that the modern world is driven by computers. A computer is a machine which can</div><div>manipulate digitized data for a particular outcome based on a program that provides it a set of</div><div>instructions. Computers are used for many business productivity and recreational tasks.</div><div>Computers are also used to access Internet networks for communication and collaboration</div><div>purposes.</div><div>Those who do not understand computers can feel left behind. It does not need to be that way,</div><div>though. Understanding the basic concepts of computing is a fairly simple process and will help</div><div>you to get a grasp of the world of the information age.</div>', 62, 0),
