(20, 'COMPUTER FUNDAMENTALS', '<div>INTRODUCTION</div><div><br></div><div>It is a fact that the modern world is driven by computers. A computer is a machine which can</div><div>manipulate digitized data for a particular outcome based on a program that provides it a set of</div><div>instructions. Computers are used for many business productivity and recreational tasks.</div><div>Computers are also used to access Internet networks for communication and collaboration</div><div>purposes.</div><div>Those who do not understand computers can feel left behind. It does not need to be that way,</div><div>though. Understanding the basic concepts of computing is a fairly simple process and will help</div><div>you to get a grasp of the world of the information age.</div><div>Unit 1 Computer Fundamentals focuses on teaching the basics of what and how to operate a</div><div>computer and its impacts to the society. Students gain first-hand information on how to be</div><div>literate on computer fundamentals. Instruction is basic and does not require experience in</div><div>technology or computers.</div>', 64, 1),
(21, 'Hardware and Software ', '<div>Design and Technology-Computing Lesson focused on Computer Hardware where computer hardware’s definition, classifications as either external or internal and its functions were thoroughly discussed. For this discussion, we will focus more on facts about computer hardware and on the parts of computer hardware (personal computers like the desktop and the laptop) with its functions and locations. Computer hardware covers a wide area of definitions to include both external (peripherals like Liquid Crystal Display (LCD), monitors and flat panel, keyboard, mouse, scanner and printer) and internal (Central Processing Unit (CPU), hard drive, motherboard, Blu-ray, DVD and CD drives, Random Access Memory (RAM), sound card and video card). Commonly known as HW (Hardware) is best described as a device that is physically connected to your computer, something tangible. Without any hardware, your computer would not exist, and software would not be able to run. The computer hardware can be upgraded. A hardware upgrade is any new hardware that replaces or adds to old hardware in the computer. A good example of a common hardware upgrade is a RAM upgrade, where the user is increasing the computers total memory. Another good example is a video card upgrade, which is the act of removing an old video card and replacing it with a new one, thus increasing the performance of the computer. A computer is a system of many parts working together. A personal computer is a common one which can either be a desktop or a laptop. Study the pictures on the below and on the next&nbsp;</div>', 67, 0),
