(19, 'Vanilla Javascript', 'What is vanilla javascript?', '<div><strong>JavaScript</strong> is a high-level, interpreted programming language primarily used for creating interactive web pages and web applications. It enables developers to add dynamic behavior to websites, handle user interactions, manipulate the <strong>DOM </strong>(Document Object Model), and communicate with servers to retrieve or send data asynchronously. JavaScript is supported by all modern web browsers and has extensive libraries and frameworks such as <strong>React</strong>, <strong>Angular</strong>, and <strong>Vue</strong>.js, making it a powerful tool for web development. Additionally, it has gained popularity in server-side development with platforms like Node.js, allowing for full-stack JavaScript development.</div><div><br></div><div><br></div><div><img src=\"src/public/topic_imgs/id_image_2024-03-28_010442920.png\"></div>');
INSERT INTO `tbl_topic_pages` (`id`, `name`, `description`, `page_content`) VALUES
(20, 'MySQL Enterprise Transparent Data Encryption (TDE)', 'What is MySQL Enterprise Edition?', '<p>MySQL Enterprise Transparent Data Encryption (TDE) protects your critical data by enabling data-at-rest encryption in the database. It protects the privacy of your information, prevents data breaches and helps meet regulatory requirements including:</p><ul><li>Payment Card Industry Data Security Standard (PCI DSS)</li><li>Health Insurance Portability and Accountability Act (HIPAA)</li><li>General Data Protection Regulation (GDPR)</li><li>California Consumer Protection Act (CCPA)</li><li>And more</li></ul><p><br></p><p><img src=\"data:image/png;base64,\"></p><p><br></p><h2>Data at Rest Encryption</h2><p>MySQL Enterprise TDE enables data-at-rest encryption by encrypting the physical files of the database. Data is encrypted automatically, in real time, prior to writing to storage and decrypted when read from storage. As a result, hackers and malicious users are unable to read sensitive data directly from database files. MySQL Enterprise TDE uses industry standard AES algorithms.</p><p>File encryption coverage:</p><ul><li><a href=\"https://dev.mysql.com/doc/refman/8.0/en/innodb-data-encryption.html#innodb-data-encryption-enabling-disabling\" target=\"_blank\" style=\"color: rgb(0, 116, 163); background-color: transparent;\">File-Per-Table Tablespace Encryption</a></li><li><a href=\"https://dev.mysql.com/doc/refman/8.0/en/innodb-data-encryption.html#innodb-general-tablespace-encryption-enabling-disabling\" target=\"_blank\" style=\"color: rgb(0, 116, 163); background-color: transparent;\">General Tablespace Encryption</a></li><li><a href=\"https://dev.mysql.com/doc/refman/8.0/en/innodb-data-encryption.html#innodb-doublewrite-file-encryption\" target=\"_blank\" style=\"color: rgb(0, 116, 163); background-color: transparent;\">Doublewrite File Encryption</a></li><li><a href=\"https://dev.mysql.com/doc/refman/8.0/en/innodb-data-encryption.html#innodb-mysql-tablespace-encryption-enabling-disabling\" target=\"_blank\" style=\"color: rgb(0, 116, 163); background-color: transparent;\">MySQL System Tablespace Encryption</a></li><li><a href=\"https://dev.mysql.com/doc/refman/8.0/en/innodb-data-encryption.html#innodb-data-encryption-redo-log\" target=\"_blank\" style=\"color: rgb(0, 116, 163); background-color: transparent;\">Redo Log Encryption</a></li><li><a href=\"https://dev.mysql.com/doc/refman/8.0/en/innodb-data-encryption.html#innodb-data-encryption-undo-log\" target=\"_blank\" style=\"color: rgb(0, 116, 163); background-color: transparent;\">Undo Log Encryption</a></li><li><a href=\"https://dev.mysql.com/doc/refman/8.0/en/replication-binlog-encryption.html\" target=\"_blank\" style=\"color: rgb(0, 116, 163); background-color: transparent;\">Binary log and Relay Log Encryption</a></li><li><a href=\"https://dev.mysql.com/doc/mysql-security-excerpt/5.7/en/audit-log-logging-configuration.html#audit-log-file-encryption\" target=\"_blank\" style=\"color: rgb(0, 116, 163); background-color: transparent;\">Audit Log Encryption</a></li></ul><p><br></p>');
INSERT INTO `tbl_topic_pages` (`id`, `name`, `description`, `page_content`) VALUES
(21, 'Computer Fundamentals', 'What is a computer?', '<div bis_skin_checked=\"1\">The computer is a super-intelligent electronic device that can perform tasks, process information, and store data. It takes the data as an input and processes that data to perform tasks under the control of a program and produces the output. A computer is like a personal assistant that follows instructions to get things done quickly and accurately. It has memory to store information temporarily so that the computer can quickly access it when needed.</div><div bis_skin_checked=\"1\"><br></div><h4>Functionalities of Computer</h4><div bis_skin_checked=\"1\">Any digital computer performs the following five operations:</div><ul><li><strong>Step 1</strong>&nbsp;− Accepts data as input.</li><li><strong>Step 2&nbsp;</strong>− Saves the data/instructions in its memory and utilizes them as and when required.</li><li><strong>Step 3&nbsp;</strong>− Execute the data and convert it into useful information.</li><li><strong>Step 4</strong>&nbsp;− Provides the output.</li><li><strong>Step 5&nbsp;</strong>− Have control over all the above four steps</li></ul><div bis_skin_checked=\"1\"><br></div><h4>The Evolution of Computers</h4><div bis_skin_checked=\"1\">A journey through the history of computers. We’ll start with the origins of computing and explore the milestones that led to the development of electronic computers.</div><div bis_skin_checked=\"1\"><br></div><div bis_skin_checked=\"1\"><img src=\"data:image/png;base64,\"></div><div bis_skin_checked=\"1\"><br></div>');
