(24, 'Computer networking', 'Sample description', '<div bis_skin_checked=\"1\"><strong>Computer networking -</strong> refers to interconnected computing devices that can exchange data and share resources with each other. These networked devices use a system of rules, called communications protocols, to transmit information over physical or wireless technologies.</div><div bis_skin_checked=\"1\"><br></div><div bis_skin_checked=\"1\"><img src=\"data:image/png;base64,\"></div>');
INSERT INTO `tbl_topic_pages` (`id`, `name`, `description`, `page_content`) VALUES
(26, 'Computer Fundamentals focuses on teaching', 'basics of what and how to operate a computer and its impacts to the society.', '<div>Students gain first-hand information on how to be</div><div>literate on computer fundamentals. Instruction is basic and does not require experience in</div><div>technology or computers.</div><div>Take note that activities are found at the end of every module lesson and summative exercises</div><div>after every topic. All answers to activities are found after the summative exercises.</div><div>The following icons are used in this module:</div><div><br></div><div>Student Aims Student Activity</div><div><br></div><div><img src=\"data:image/png;base64,\"></div><div><br></div><div><br></div><div>Time Frame </div><div><img src=\"data:image/png;base64,\"></div><div>Note</div><div><img src=\"data:image/png;base64,\"></div><div><br></div><div>Practical Student Activity </div><div><img src=\"data:image/png;base64,\"></div><div>Answers to Learning Activities</div><div><img src=\"data:image/png;base64,\"></div><div><br></div><div>Student Aims</div><div><img src=\"data:image/png;base64,\"></div><div>On successful completion of this module, students will be able to:</div><div><br></div><div>• identify and demonstrate the appropriate use of a range of hardware and software</div><div>components and peripheral devices</div><div>• describe major components of a computer system and explain their functions</div><div><br></div><div>Time Frame</div><div><img src=\"data:image/png;base64,\"></div><div>This unit should be completed within 10 weeks.</div><div>If you set an average of 3 hours per day, you should be able to complete the unit comfortably by</div><div>the end of the assigned week.</div><div>Try to do all the learning activities and compare your answers with the ones provided at the end</div><div>of the unit. If you do not get a particular exercise right in the first attempt, you should not get</div><div>discouraged but instead, go back and attempt it again. If you still do not get it right after several</div><div>attempts then you should seek help from your friend or even your tutor. Do not pass any question</div><div>without solving it first.</div>');
INSERT INTO `tbl_topic_pages` (`id`, `name`, `description`, `page_content`) VALUES
(27, 'Computer Concepts', 'The Information Processing Cycle (IPC)', '<div>The Information Processing Cycle (IPC) is a necessary process to learn in order to understand how</div><div>a computer function. The IPC reflects the steps that data must follow to become a useful set of</div><div>information. These are the steps that are taken to convert raw facts (data) into information.</div><div>The sequence of events in processing information includes (1) input, (2) processing, (3) storage</div><div>and (4) output. These processes work together and repeat over and over.</div><div>1. Input refers to entering data into the computer.</div><div>2. Processing involves performing operations on the data.</div><div>3. Storage includes saving data, programs, or output for future use.</div><div>4. Output covers the presentation of the results.</div><div><img src=\"data:image/png;base64,\"></div><div>Let us briefly discuss each stage.</div><div>1. Input</div><div>This is the first event in the cycle. This stage involves collection of data from the outside or also</div><div>from within the system. It is the collection of raw data from the outside world so it can be put</div><div>into an information system. This means putting the acquired data into the information system.</div><div>Examples:</div><div>a. The payroll clerk collects workers\' timecards so he knows how many hours each</div><div>person worked that week and types the hours from the timecards into a spreadsheet</div><div>using MS Excel.</div><div><br></div><div>The Information Processing Cycle</div><div><br></div><div><br></div><div>b. Conducting a survey of customers’ opinions on a new product and then scanning the</div><div>survey cards with a card reader.</div><div>c. Collecting quotes for a quote book and typing quotes into a word processor like</div><div>MS Word.</div><div>d. Using a form on an insurance website to collect visitors\' opinions.</div><div>Keyboards, mice, flatbed scanners, bar code readers, joysticks, digital data tablets (for graphic</div><div>drawing), electronic cash registers and others are some of the typical input devices.</div><div>2. Processing</div><div>In this stage the computer processes the tiniest details entered. This processing makes the data</div><div>entered usable. This is the interpretation of data input in the computer system through a</div><div>processor commonly known as the Central Processing Unit (CPU). The CPU as the processor is the</div><div>key component in a digital computer capable of executing a program. It interprets computer</div><div>programs instructions and processes data. CPUs provide the fundamental digital computer trait</div><div>of programmability, and are one of the necessary components found in computers of any era,</div><div>along with memory and input/output facilities.</div><div>A CPU that is manufactured as a single integrated circuit is usually known as a microprocessor.</div><div>Beginning in the mid-1970s, microprocessors of ever-increasing complexity and power gradually</div><div>supplanted other designs, and today the term \"CPU\" is usually applied to some type of</div><div>microprocessor. More of this will be discussed further when you reach the topic on Parts of a</div><div>Computer.</div><div>Typical processing software includes:</div><div>a. Word Processors</div><div>b. Spreadsheet</div><div>c. Payroll Systems</div><div>d. Web Browsers</div><div><br></div><div>3. Output</div><div>Output is the process of transmitting the processed information. If you have to look at the</div><div>diagram of information processing cycle, the step after processing is the output stage. The</div><div>processed information is now transmitted to the user. Basically, output is the presentation of any</div><div>data exiting a computer system. This could be in the form of printed paper, audio or video. In the</div><div>medical industry this might include CT scans or x- rays. Typical output devices include monitors,</div><div>printers, speakers and the likes.</div><div><br></div><div><br></div><div>4. Storage</div><div>Storage is also known as mass storage which refers to various techniques and devices for storing</div><div>large amounts of data. After the data has been processed, along with the output</div><div>to the user, the data is also stored. Different computer storage devices can be used for the same</div><div>purpose.</div><div><br></div><div>The earliest storage devices were punched paper cards. These were used as early as 1804 to</div><div>control silk-weaving looms. Modern mass storage devices include all types of disk drives</div><div>and tape drives. Mass storage is measured in kilobytes (1,024 bytes), megabytes (1,024</div><div>kilobytes), gigabytes (1,024 megabytes) and terabytes (1,024 gigabytes).</div><div>Examples of storage devices include primary storage (RAM/ROM) and secondary storage devices</div><div>(external hard drives, CD/DVD, memory cards and flash drives). A more thorough</div><div>discussion on this will be shown in the topic Storage Devices.</div><div>The most important advantage of the information processing cycle is that the information is</div><div>processed quickly. At the same time retrieving the data is an easy task as well. The processed</div><div>information can further be passed onto the next stage directly in case need be. The necessary</div><div>data is stored, which helps in avoiding duplication of data as well as time. One has to take note</div><div>however that from the process, a step might not be taken like for example, after input and</div><div>process, the user might not save or print his work.</div>');
INSERT INTO `tbl_topic_pages` (`id`, `name`, `description`, `page_content`) VALUES
(28, 'Student Activity', 'answer the questions that follow.', '<div>Derick needs to draw up a budget report. He opened his computer and started typing using the</div><div>word processor. He entered all the necessary figures and information to create the report. After</div><div>checking his work, he saved it in his flash drive and printed three copies for his superiors.</div><div>Identify the input, process, output and storage from the given situation. Fill out the diagram</div><div>below:</div><div><img src=\"data:image/png;base64,\"></div><div><br></div>');
